Texas is facing yet another traumatic winter storm leaving many without power and access to basic needs. We are also still experiencing the effects of the winter storm of 2021 while in the midst of the latest ice storm. Many are without power or sitting with the fear of losing their power at any moment. To those needing to move through trauma, here are some ways to orient your nervous system back to safety:
❄️Social Engagement
❄️Rest
❄️Self Compassion
❄️Support basic needs: food, water, comfort 
❄️Move your body
❄️Take action (orgs you can donate to):
@austinmutualaid 
@austinstreetcenter 
@austinpetsalive 
@houstonfoodbank 
@f_r_e_e_lunch
@northtexasfoodbank 
@lifeworksaustin 
@caritasofaustin 
Take good care Texas, the MPP team is sending you warmth and comfort ❤️. We’ll get through this together.
